package collections.vector;import java.util.Vector;public class VectorBasic {    public static void main(String[] args) {        Vector<Integer> vector = new Vector<Integer>();        vector.add(12);        vector.addElement(12);        vector.addElement(null);        System.out.println("Size of Vector is " + vector.size());        for (Integer integer : vector) {            System.out.println("Vector Item is " + integer);        }        vector.clear();        System.out.println("Size of Vector after clear " + vector.size());    }}